import Footer from "../Footer";

const styles = {
    h4: {
      fontSize: 50,
    },
  };

function Home() {
  return (
    <>
      <h1 style={styles.h4} >Hi my name is Umair</h1>
      <h2>The developing developer</h2>
      <img src="./images/me.png"/>
      <h3>Welcome to my portfolio site</h3>
      <Footer></Footer>
    </>
  );
}

export default Home;
